import React from 'react';
import './Test.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {
  faCircleXmark,
  faLocationDot,
  faMagnifyingGlass,
  faMapLocationDot,
  faPhone,
  faStar,
} from '@fortawesome/free-solid-svg-icons';

const Test = () => {
  return (
    <div className='search-the-area'>
      <div className='div'>지역검색</div>
      <input type='text' className='search'></input>
      <a href='#'>
        <FontAwesomeIcon icon={faMagnifyingGlass} className='vector' />
      </a>
    </div>
  );
};

export default Test;
